import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Homepage() {
  return (
    <div>
      <h1 style={{ color: "light_blue" }}>인뱅</h1>
      <h2>In-Bang</h2>
      <p>This is our homepage!</p>
      <Link to="/login">
        <button
          style={{
            backgroundColor: "blue",
            color: "white",
            padding: "5px",
          }}
        >
          Get Started >
        </button>
      </Link>
    </div>
  );
}

export default Homepage;
